(40, '<h1 class=\"pinfo__heading\">block joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<p><strong>THE BIG KID ON THE BLOCK<br></strong><br><span>⁃ Regular fit</span><br><span>⁃ Elasticated waistband with rounded drawcords</span><br><span>⁃ Elasticated ankle cuffs</span><br><span>⁃ Open side pockets</span><br><span>⁃ Printed Block logo to thigh</span><br><span>⁃ 70% Cotton, 30% Polyester</span><br><span>⁃ Model is 6’2” and wears size M</span><br><span>⁃ Label Colour: </span>Athletic Marl/White</p>\n<p><span></span><span>The unmissable Block logo has become a part of the Gymshark story. Call on the Block Joggers for anything from your toughest training day to your laziest rest day with a supple 30% polyester content and stay-put elasticated features.</span></p>\n</div>', NULL, 35, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingblock-joggersh1', NULL, '2020-04-20 00:10:33', '2020-04-20 00:10:33'),
(41, '<h1 class=\"pinfo__heading\">luxe legacy joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE NEXT GENERATION</strong><br><br><span>⁃ Slim fit</span><br><span>⁃ Tapered-to-ankle shape</span><br><span>⁃ Contrast block panels</span><br><span>⁃ Zip side pockets</span><br><span>⁃ Adjustable drawcord waistband</span><br><span>⁃ Embroidered classic Gymshark and Luxe logos to sides</span><br><span>⁃ 85% Cotton, 15% Elastane</span><br><span>⁃ Model is 6’2” and wears size M</span><br><span>⁃ Label Colour: Black</span><br><br><span>The Luxe Legacy Joggers are a genuine Gymshark original, featuring our famous tapered fit and classic Gymshark logo. Now, they’re back, with new zip side pockets and an improved material blend that mixes comfort and movement, alongside the renowned contrast colour blocks from the OG generation.</span>\n</div>', NULL, 50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-joggersh1', NULL, '2020-04-20 00:10:34', '2020-04-20 00:10:34'),
(42, '<h1 class=\"pinfo__heading\">luxe legacy joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>THE NEXT GENERATION</strong><br><br> ⁃ Slim fit<br> ⁃ Tapered-to-ankle shape<br> ⁃ Contrast block panels<br> ⁃ Zip side pockets<br> ⁃ Adjustable drawcord waistband<br> ⁃ Embroidered classic Gymshark and Luxe logos to sides<br> ⁃ 85% Cotton, 15% Elastane<br> ⁃ Model is 6’2” and wears size M<br> ⁃ Label Colour: Blue Lagoon<br><br>The Luxe Legacy Joggers are a genuine Gymshark original, featuring our famous tapered fit and classic Gymshark logo. Now, they’re back, with new zip side pockets and an improved material blend that mixes comfort and movement, alongside the renowned contrast colour blocks from the OG generation.</div>', NULL, 50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-joggersh1', NULL, '2020-04-20 00:10:35', '2020-04-20 00:10:35'),
(43, '<h1 class=\"pinfo__heading\">luxe legacy joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<strong>THE NEXT GENERATION</strong><br><br><span>⁃ Slim fit</span><br><span>⁃ Tapered-to-ankle shape</span><br><span>⁃ Contrast block panels</span><br><span>⁃ Zip side pockets</span><br><span>⁃ Adjustable drawcord waistband</span><br><span>⁃ Embroidered classic Gymshark and Luxe logos to sides</span><br><span>⁃ 85% Cotton, 15% Elastane</span><br><span>⁃ Model is 6\'1” and wears size M</span><br><span>⁃ Label Colour: White </span><br><br><span>The Luxe Legacy Joggers are a genuine Gymshark original, featuring our famous tapered fit and classic Gymshark logo. Now, they’re back, with new zip side pockets and an improved material blend that mixes comfort and movement, alongside the renowned contrast colour blocks from the OG generation.</span>\n</div>', NULL, 50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingluxe-legacy-joggersh1', NULL, '2020-04-20 00:10:36', '2020-04-20 00:10:36'),
(44, '<h1 class=\"pinfo__heading\">critical joggers</h1>\n', '<div class=\"pdp-accordion__body\">Get the job done.<br><br> ⁃ Slim fit<br> ⁃ Tapered-to-ankle shape<br> ⁃ Ribbed cuffs<br> ⁃ Adjustable drawcord waist<br> ⁃ Side pockets<br> ⁃ Embroidered Gymshark logo<br> ⁃ 60% Polyester, 35% Cotton, 5% Elastane<br> ⁃ Model is 6\'0\" and wears size M <br>- Label Color: Black<br><br>The joggers every gym bag needs: understated, comfortable and reliable. The multi-fabric construction of the Critical Joggers offers the stretch to support and endure training session upon training session.</div>', NULL, 30, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingcritical-joggersh1', NULL, '2020-04-20 00:10:37', '2020-04-20 00:10:37'),
(45, '<h1 class=\"pinfo__heading\">tapered bottoms</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p class=\"p1\"><span class=\"s1\">A true Gymshark original, boasting a refined and effortless design.</span></p>\n<p class=\"p1\"><span class=\"s1\">Constructed from soft stretch, cotton blend fabric, the Tapered Bottoms boast a liberating range of movement, whilst providing the perfect fit. Tailored for a subtle, relaxed fit, the Tapered Bottoms accentuate your physique effortlessly.</span></p>\n<p class=\"p1\"><span class=\"s1\">With adjustable drawcord waistband, concealed zip pockets and classic Gymshark printed logo, you’re covered from your toughest training day to your most chilled rest day.</span></p>\n<p class=\"p1\"><span class=\"s1\">50% Polyester, 43% Cotton, 7% Elastane.</span></p>\n<p class=\"p1\"><span class=\"s1\">Model is 6\'1\" and wears a size M. </span></p>\n<p class=\"p1\"><span class=\"s1\">Label Colour: Hunter Green</span></p>\n</div>', NULL, 45, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtapered-bottomsh1', NULL, '2020-04-20 00:10:38', '2020-04-20 00:10:38'),
(46, '<h1 class=\"pinfo__heading\">tapered bottoms</h1>\n', '<div class=\"pdp-accordion__body\">\n<meta charset=\"utf-8\">\n<p class=\"p1\"><span class=\"s1\">A true Gymshark original, boasting a refined and effortless design.</span></p>\n<p class=\"p1\"><span class=\"s1\">Constructed from soft stretch, cotton blend fabric, the Tapered Bottoms boast a liberating range of movement, whilst providing the perfect fit. Tailored for a subtle, relaxed fit, the Tapered Bottoms accentuate your physique effortlessly.</span></p>\n<p class=\"p1\"><span class=\"s1\">With adjustable drawcord waistband, concealed zip pockets and classic Gymshark printed logo, you’re covered from your toughest training day to your most chilled rest day.</span></p>\n<p class=\"p1\"><span class=\"s1\">50% Polyester, 43% Cotton, 7% Elastane.</span></p>\n<p class=\"p2\"><span class=\"s1\">Model is 6\'1\" and wears size M.</span></p>\n</div>', NULL, 45, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtapered-bottomsh1', NULL, '2020-04-20 00:10:39', '2020-04-20 00:10:39'),
(47, '<h1 class=\"pinfo__heading\">tapered bottoms</h1>\n', '<div class=\"pdp-accordion__body\">\n<p class=\"p1\"><span class=\"s1\">A true Gymshark original, boasting a refined and effortless design.</span></p>\n<p class=\"p1\"><span class=\"s1\">Constructed from soft stretch, cotton blend fabric, the Tapered Bottoms boast a liberating range of movement, whilst providing the perfect fit. Tailored for a subtle, relaxed fit, the Tapered Bottoms accentuate your physique effortlessly.</span></p>\n<p class=\"p1\"><span class=\"s1\">With adjustable drawcord waistband, concealed zip pockets and classic Gymshark printed logo, you’re covered from your toughest training day to your most chilled rest day.</span></p>\n<p class=\"p1\"><span class=\"s1\">50% Polyester, 43% Cotton, 7% Elastane.</span></p>\n<p class=\"p2\"><span class=\"s1\">Main Image/ Left Model is 6\'1\" and wears size M Right Model is 6\'3\" and wears XXL</span></p>\n</div>', NULL, 45, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingtapered-bottomsh1', NULL, '2020-04-20 00:10:39', '2020-04-20 00:10:39'),
(48, '<h1 class=\"pinfo__heading\">speed joggers</h1>\n', '<div class=\"pdp-accordion__body\">\n<strong>STEP INTO CARDIO</strong><br><br> ⁃ Slim fit<br> ⁃ Tapered-to-ankle shape<br> ⁃ Lightweight material<br> ⁃ Air-mesh waistband with adjustable drawcords<br> ⁃ Mesh panelling to gusset and back<br> ⁃ Perforation to lower back leg<br> ⁃ Zip side pockets<br> ⁃ Printed Gymshark logo to thigh<br> ⁃ Main: 88% Polyester, 12% Elastane. Mesh: 85% Polyamide, 15% Elastane. Lower Leg: 80% Polyamide, 20% Elastane.<br> ⁃ Model is 6’2” and wears size S<br> ⁃ Label Color: Smokey Grey<br><br>Step into cardio in the Speed Pants. There’s no mile too far or speed too fast with a lightweight, supple polyester-elastane blend and reliable, stay-put fit. And - thanks to breathability features including mesh panels, an air-mesh waistband and perforation to the back leg - it doesn’t matter how out of breath the cardio’s got you, these bottoms will continue breathing just fine.</div>', NULL, 50, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'h1-classpinfo-headingspeed-joggersh1', NULL, '2020-04-20 00:10:40', '2020-04-20 00:10:40');

